import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap';
import '../node_modules/bootstrap/dist/css/bootstrap.css';




class App extends Component {

  constructor(props){
    super(props);

    this.state = {dados:[
      {componente:'Primeiro...',
      id:1},
      {componente:'Segundo...',
      id:2},
      {componente:'Terceiro...',
      id:3}
    ]}

  }




  render() {

    return (
      <div class="container">     
       <div class="card">
            <ul class="list-group list-group-flush">  
          {this.state.dados.map((info,chave) => <Conteudo key = {chave} dadosComponente = {info} />)}  
          </ul>       
       </div>
       </div>
    )
  }
}


class Conteudo extends Component{
   render(){
      return ( 

        <li class="list-group-item">{this.props.dadosComponente.componente}</li>         


      )
   }
}

export default App;
